import "./App.css";

import { BrowserRouter, Routes, Route } from "react-router-dom";
import Comp1 from "./components/Comp1";
import Comp2 from "./components/Comp2";
import CompUser from "./components/CompUser";
import CompsShowUser from "./components/CompsShowUser";

function App() {
  return (
    <div className="App d-flex flex-column">
      <BrowserRouter>
        <Comp1 />
        <Comp2 />
        <CompUser />
        <CompsShowUser />
        <Routes>{/* <Route path="/" element={<SEssionExap />} /> */}</Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
